/* eslint-disable jsx-a11y/anchor-is-valid */
import styles from "./Header.module.css";

function Header() {
    return (
        <header>
            <nav className={styles.navbar}>
      <div className={styles.navleft}>
        <a href="cadastro.html" className={styles.cadastrese}>Cadastre-se</a>
        <a href="login.html" className={styles.navlinksl}>Login</a>
        <a href="#" className={styles.navlinks}>Sobre nós</a>
      </div>
      <span href="index.html" className={styles.brand}>JUSTIX</span>
    </nav>
        </header>
    );
}

export default Header;
